def lengthOfLongestSubstring(s: str) -> int:
        
    current_longest = 0    # Current answer
    current_substring = s  # Current string to check
    length = len(s)
    start = 0              # Determines the starting point of string
    end = length       # Determines the ending point of the string 
        
    # Go until no more valid substrings are available
    while(current_substring):
            
        unique_length = len(set(current_substring)) # Number of unique characters in the string
            
        # Finds the longest unique substring given the curretn starting key
        if (unique_length == len(current_substring) and (unique_length > current_longest)):
            current_longest = unique_length

            start += 1         # Move the start key up one
            end = length       # restart end
            
        else:
            end -= 1 # Move the end key to the left
            if ((end - start) <= current_longest): # If the substrings are exhausted
                start += 1
                end = length

    
        current_substring = s[start:end] # Update the current string

    return current_longest


def lengthOfLongestSub(s: str) -> int:
    max_length = 0
    non_rep_sub_str = ""
    for i in s:
        if i in non_rep_sub_str:
            non_rep_sub_str = non_rep_sub_str.split(i)[1] + i
        else:
            non_rep_sub_str += i
            max_length = max(max_length, len(non_rep_sub_str))
    return max_length





